import './App.css';
import Header from './components/header';
import List from './components/list';
import { Route, Routes } from 'react-router-dom';
function App() {
  return (
    <Routes>
      <Route index element={<List />}/>

      <Route path='/login' element={<div>Login</div>} />
      <Route path='/register' element={

        <div>Register</div>
      } />


    </Routes>

  );
}

export default App;
